import Head from "next/head";
import AppBar from "./Header/appBar";

const Layout = (props) => (
  <React.Fragment>
    <Head>
      <title>Tracthon</title>
    </Head>

    <AppBar />
    {props.children}
  </React.Fragment>
);

export default Layout;
